import React from 'react';
import './YouTubeVideoListHolder.css';

import YouTubeVideoList from '../YouTubeVideoList/YouTubeVideoList';

class YouTubeVideoListHolder extends React.Component {
  render() {
    return (

      /*<div className="video_list_holder">
        {
          this.props.video_list.map(videolist => {
            return <YouTubeVideoList title={videolist.title} videos={videolist.videos} />
          })
        }
      </div>
      */

      <div className="video_list_holder">
        <YouTubeVideoList videoList={this.props.video_list}/>
        {this.props.videoList.map(video => <p>{video.title}</p>)}
      </div>
    );
  }
}

export default YouTubeVideoListHolder;
